import React from 'react';

import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';

function Ranking() {
  return (
    <Container maxWidth="sm">
      <svg viewBox="0 0 200 200" xmlns="http://www.w3.org/2000/svg">
        <path fill="#315bcd" d="M40,-63.8C51.6,-54.8,60.4,-43.2,67.2,-30.2C74,-17.1,78.8,-2.5,78.5,12.5C78.2,27.5,72.9,43.1,62,51.3C51.1,59.5,34.5,60.4,19,65.4C3.4,70.4,-11.3,79.5,-24.9,78.4C-38.5,77.3,-51,66.2,-57.1,52.9C-63.3,39.7,-63.2,24.4,-64.5,9.8C-65.9,-4.8,-68.6,-18.7,-64,-29.4C-59.4,-40,-47.3,-47.4,-35.4,-56.3C-23.5,-65.1,-11.7,-75.4,1.2,-77.3C14.2,-79.3,28.5,-72.8,40,-63.8Z" transform="translate(100 100)" />
      </svg>
      <Typography
        variant="h4"
        align="center"
        sx={{
          position: 'relative',
          top: '-18rem',
        }}
      >
        Le classement

      </Typography>
    </Container>
  );
}

export default Ranking;
